description:
Kontrast &amp; Fo Chief present Cannonball Soup: The Appetizer. Known best as members of the Colorado Hip-Hop collective Fresh Breath Committee, and fresh off their classic project &quot;Cannonball Soup,&quot; they have released a compilation to whet your appetite until the full-length album drops this winter! They have joined forces with DJ Bedz, team DJ for the Denver Broncos and Denver Nuggets, radio personality on KPTT 95.7 and member of the infamous Radiobums to bring you this very special mixtape release!


Download Link: http://www.datpiff.com/Kontrast-Fo-Chief-Cannonball-Soup-The-Appetizer-mixtape.648198.html



